import React from 'react';
import { Button, Navbar, NavbarBrand } from "reactstrap";


function CustomNavbar() {
  return (
    <div>
        <Navbar 
          className="my-2"
          color="dark"
          dark
        >
          <NavbarBrand>
            <Button>Giri≈ü</Button>
          </NavbarBrand>
        </Navbar>
      </div>
  );
}

export default CustomNavbar;
